import React from 'react'

export default class Contact extends React.Component {
  render() {
    var __html = require('./contact.html');
    var contact = { __html: __html };
    return (
      <div className="contact-page">
        <div className="mainpage-banner page contact-banner">
          <h1 className="mainpage-banner-text">In a global society, communication is the key</h1>
        </div>
         <div dangerouslySetInnerHTML={contact} />
      </div>
    )
  }
}
